import {Navbar, Nav, NavItem, NavDropdown, MenuItem, Container, Image} from 'react-bootstrap';

const NavigationBar = () => {
    return(
        <Navbar bg="light" expand="lg">
            <Container>
                <Navbar.Brand>
                    <img 
                    alt=""
                    src="../public/mask-group28@2x.png"
                    width="30"
                    height="30"/>
                </Navbar.Brand>
            </Container>
        </Navbar>
    );
}

export default NavigationBar;
